import * as React from 'react';
import { SideBarListElement } from './SideBarListElement'

interface Props {

}

const myStyle = {
    color: '#FFF',
    // listStyleType: 'none';
}

export const SideBarList: React.FC<Props> = () => {
    return ( 
        <div>
            <ul style={myStyle}>
                <SideBarListElement name='Assets' />
                <SideBarListElement name='Trade' />
                <SideBarListElement name='Pay' />
                <SideBarListElement name='For You' />
                <SideBarListElement name='Learn and earn' />
                <SideBarListElement name='Notifications' />
                <SideBarListElement name='Invite Friends' />
            </ul>
        </div>
     );
}
